useEffect(() => {
  fetch("http://localhost:3001/api/products")
    .then((response) => {
      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }
      return response.json();
    })
    .then((data) => {
      const jacketsData = data.filter(product => product.category === 'jackets'); // Update category to 'jackets'
      setJackets(jacketsData);
      setLoading(false);
    })
    .catch((error) => {
      console.error("Error fetching jackets:", error);
      setLoading(false);
    });
}, []);
